-- View structure for payments
-- ----------------------------
DROP VIEW IF EXISTS `payments`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `payments` AS select `clients`.`id` AS `id`,`clients`.`name` AS `name`,`clients`.`surname` AS `surname`,`payment`.`cash` AS `cash`,`payment`.`date` AS `date`,`payment`.`capturer` AS `capturer`,`payment`.`d` AS `d`,`stand`.`location` AS `location`,`stand`.`number` AS `number`,`stand`.`area` AS `area`,`stand`.`price` AS `price` from (((`payment` join `stand` on((`payment`.`stand` = `stand`.`id_stand`))) join `clients` on((`clients`.`stand_id` = `payment`.`stand`))) join `owners` on(((`clients`.`id` = `owners`.`client_id`) and (`clients`.`stand_id` = `owners`.`stand_id`)))) ;

