DROP VIEW IF EXISTS `stand owners`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `stand owners` owners` AS select `clients`.`name` AS `name`,`clients`.`surname` AS `surname`,`clients`.`file_number` AS `file_number`,`clients`.`office` AS `office`,`clients`.`idnum` AS `idnum`,`clients`.`contact` AS `contact`,`stand`.`location` AS `location`,`stand`.`area` AS `area`,`stand`.`number` AS `number`,`stand`.`price` AS `price`,`stand`.`deposit` AS `deposit`,`stand`.`instalments` AS `instalments`,`stand`.`datestatus` AS `datestatus` from ((`owners` join `clients` on((`clients`.`id` = `owners`.`client_id`))) join `stand` on((`stand`.`id_stand` = `owners`.`stand_id`))) ;
